import React from 'react';
import './About.css';

function About() {
  return (
    <div className="about-container">
      <h2>/ about me</h2>
      <p>I am a data analyst specializing in business analytics...</p>
      <ul>
        <li>Typescript</li>
        <li>Python</li>
        <li>React.js</li>
        <li>Java</li>
      </ul>
    </div>
  );
}

export default About;
